import React, { useEffect, useState } from "react";
import axios from "axios";
import API_URL from "../config";

const SismosTable = () => {
    const [sismos, setSismos] = useState([]);

    useEffect(() => {
        axios.get(API_URL)
            .then(response => setSismos(response.data))
            .catch(error => console.error("Error al obtener sismos:", error));
    }, []);

    return (
        <div>
            <h2>Lista de Sismos</h2>
            <table>
                <thead>
                    <tr>
                        <th>Fecha</th>
                        <th>Hora</th>
                        <th>Magnitud</th>
                        <th>Latitud</th>
                        <th>Longitud</th>
                        <th>Profundidad</th>
                        <th>Ubicaci√≥n</th>
                    </tr>
                </thead>
                <tbody>
                    {sismos.map((sismo, index) => (
                        <tr key={index}>
                            <td>{sismo.fecha}</td>
                            <td>{sismo.hora}</td>
                            <td>{sismo.magnitud || "No calculable"}</td>
                            <td>{sismo.latitud}</td>
                            <td>{sismo.longitud}</td>
                            <td>{sismo.profundidad} km</td>
                            <td>{sismo.referenciaLocalizacion}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default SismosTable;
